description:
Battle of Britain (1969) 

PLOT: A powerful and colorful portrayal of an understaffed, technically inferior royal air-crew who valiantly holds off the superior forces of the German Luftwaffe. This pivotal battle of World War II could have led to the Germans winning the war. The incredible cast includes Michael Caine, Robert Shaw, Curt Jurgens, and Laurence Olivier. Based on the actual events. 

RUNNING TIME: 213 minutes.


